import './css/main.css';
import './css/fonts.css';
import React from 'react';
import Logo from './img/icsm-logo.png';

const head = (
  <head>
  <meta charset="utf-8" />
  <link rel="icon" href="%PUBLIC_URL%/favicon.ico" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <meta name="theme-color" content="#000000" />
  <meta
    name="description"
    content="ICSM Coding App Description"
  />
  <link rel="apple-touch-icon" href="%PUBLIC_URL%/logo192.png" />
  <link rel="manifest" href="%PUBLIC_URL%/manifest.json" />

  {/* Google fonts */}

  <title>ICSM Coding</title>
</head>
);

const overviewListItems = ['Interactive exercises', 'Real world projects','Competitions','Weekly drop-in Q&A sessions'];
const overviewList = overviewListItems.map(e => <li className='overview__item'>{e}</li>)

const html = ( 
<body>
  <header className='header'>
    <div className='header__text-box'>
    <h1 className="primary-title color-blue">Python Course</h1>
    <h1 className="secondary-title color-blue margin-big hidden ">
      Autumn Term
    </h1>
<a href='#' className='btn btn-primary'>SIGN UP</a>
    </div>
  </header>

  <div className="overview">
    <div className='overview__text-box'>
        <h2 className='secondary-title'>10 Week Course</h2>
        <h3 className='tertiary-title'>Build you knowledge from the basics</h3>
        <ul>
          {overviewList}
        </ul>
    </div>
  </div>

  <footer className="footer">
    <img src={Logo} alt="" height="60%"/>
    <hr className='hr-footer'></hr>
    <ul className="footer__list">
      <li className="footer__item"><a href="" className="footer__link">icsm coding</a></li>
      <li className="footer__item"><a href="" className="footer__link">contact</a></li>
      <li className="footer__item"><a href="" className="footer__link">team</a></li>
    </ul>
  </footer>

  <section className="video">
  <iframe class="player ka-player-iframe centered-when-windowed _1rzb079g" name="ka-player-iframe" id="video_G4doTGQPRPw" title="Video: Decimal system refresher" type="text/html" frameborder="0" allowfullscreen="" src="https://www.youtube-nocookie.com/embed/G4doTGQPRPw/?controls=1&amp;enablejsapi=1&amp;modestbranding=1&amp;showinfo=0&amp;origin=https%3A%2F%2Fwww.khanacademy.org&amp;iv_load_policy=3&amp;html5=1&amp;fs=1&amp;rel=0&amp;hl=en&amp;cc_lang_pref=en&amp;cc_load_policy=1&amp;start=0" width="800" height="480" data-youtubeid="G4doTGQPRPw" data-translatedyoutubeid="G4doTGQPRPw" tabindex="0" allow="autoplay"></iframe>
    <iframe width="560" height="315" src="https://www.youtube.com/embed/gMiq50rNOlA" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
  </section>

</body>
);

function App() {
  return (
    head,
    html
  );
}

export default App;
